import React from "react";
import Chart from "./Chart";

import ExpenseForm from "./ExpenseForm";
import "./NewExpense.css";

const NewExpense = (props) => {
  const saveExpenseDataHandler = (enteredExpenseData) => {
    const expenseData = {
      ...enteredExpenseData,
      id: Math.random().toString(),
    };
    // console.log(expenseData);
    props.onAddExpense(expenseData);
  };

  const clickAddNewExpensesHandler = () => {
    console.log("clickAddNewExpensesHandler");
  };

  let expenseForm = <ExpenseForm onSaveExpenseData={saveExpenseDataHandler} />;
  let expenseForm2 = <Chart onAddNewExpenses={clickAddNewExpensesHandler} />;

  return <div className="new-expense">{expenseForm2}</div>;
};

export default NewExpense;
